<template>
  <div class="container">
    <div class="columns is-vcentered">
      <div class="column is-full">
        <div class="box">
          <h1 class="title">AIA CES Certificate Creator</h1>
          <div class="columns">
            <div class="column">
              <label class="label">
                Participant Name:
                <input class="input" type="text" v-model="name" />
              </label>
            </div>
            <div class="column">
              <label class="label">
                Participant AIA #:
                <input class="input" type="number" v-model="memberId" />
              </label>
            </div>
          </div>

          <div class="columns">
            <div class="column">
              <label class="label">
                Session Number:
                <input class="input" type="number" v-model="session" />
              </label>
            </div>
            <div class="column">
              <label class="label">
                Session Date:
                <flat-pickr
                  class="input"
                  :config="config"
                  name="date"
                  placeholder="Select Date"
                  v-model="date"
                ></flat-pickr>
              </label>
            </div>
          </div>

          <div class="columns">
            <div class="column">
              <label class="label">
                Instructor(s):
                <input class="input" type="text" v-model="instructor" />
              </label>
            </div>
            <div class="column">
              <label class="label">
                Location:
                <input class="input" type="text" v-model="location" />
              </label>
            </div>
          </div>

          <div class="columns">
            <div class="column">
              <label class="label">
                Course Number:
                <div class="select">
                  <select class="input" v-model="courseNumber">
                    <option value="ESC001">ESC001</option>
                    <option value="ESC002">ESC002</option>
                  </select>
                </div>
              </label>
            </div>
            <div class="column">
              <label class="label">
                Course Title:
                <div class="select">
                  <select class="input" v-model="courseTitle">
                    <option
                      value="High-Performance Windows in Sustainable Building Design"
                      >High-Performance Windows in Sustainable Building
                      Design</option
                    >
                    <option value="Cork as a Building Material"
                      >Cork as a Building Material</option
                    >
                  </select>
                </div>
              </label>
            </div>
          </div>

          <div class="columns">
            <div class="column">
              <label class="label">
                Provider Company:
                <input class="input" type="text" v-model="providerOrg" />
              </label>
            </div>
            <div class="column">
              <label class="label">
                Provider Name:
                <input class="input" type="text" v-model="providerName" />
              </label>
            </div>
            <div class="column">
              <label class="label">
                Provider AIA Number:
                <input class="input" type="text" v-model="providerNumber" />
              </label>
            </div>
          </div>

          <div class="columns">
            <div class="column">
              <label class="label">
                Credits:
                <input class="input" type="text" v-model="credits" />
              </label>
            </div>
            <div class="column">
              <label class="label"
                >Credit Type:<br />
                <div class="select">
                  <select class="input" v-model="creditType">
                    <option value="LU">LU</option>
                    <option value="LU | HSW">LU | HSW</option>
                  </select>
                </div></label
              >
            </div>
          </div>

          <br />
          <div
            v-if="
              name &&
                memberId &&
                session &&
                date &&
                instructor &&
                location &&
                courseNumber &&
                courseTitle &&
                providerName &&
                providerNumber
            "
          >
            <button class="button is-success is-large" @click="createPDF">
              Create Certificate
            </button>
          </div>
          <div v-else>
            <button class="button is-light is-large" disabled>
              Create Certificate
            </button>
          </div>
          <br />
          <p class="has-text-centered">
            Built with
            <a href="https://vuejs.org/" target="_blank">Vue.js</a> by JXL
            Studio
          </p>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
import jsPDF from "jspdf";
import flatPickr from "vue-flatpickr-component";
import "flatpickr/dist/flatpickr.css";
import "flatpickr/dist/themes/airbnb.css";

export default {
  name: "home",
  components: {
    flatPickr
  },
  data() {
    return {
      name: this.getName(""),
      memberId: this.getAiaNumber(),
      session: null,
      courseTitle: "High-Performance Windows in Sustainable Building Design",
      courseNumber: "ESC001",
      providerOrg: "Eco Supply",
      providerName: "Jeremy Ledford",
      providerNumber: "38836605",
      credits: "1",
      creditType: "LU | HSW",
      date: null,
      // Get more form https://chmln.github.io/flatpickr/options/
      config: {
        altFormat: "m/d/Y",
        altInput: true,
        dateFormat: "m/d/Y"
      },
      instructor: this.getInstructor(),
      location: this.fullAddress()
    };
  },
  computed: {
    mId: function() {
      if (this.memberId != null) {
        var md = " (#" + this.memberId + ")";
      } else {
        md = "";
      }
      return md;
    }
  },
  methods: {
    createPDF: function() {
      var doc = new jsPDF("p", "in", "letter");
      var title = "AIA CES " + this.courseNumber + " Certificate";
      var pdfTitle = this.name + " - " + title + ".pdf";
      var textArray = [
        "Course Title: " + this.courseTitle,
        "Course Number: " + this.courseNumber,
        "Provider: " + this.providerOrg,
        "Credit: " + this.credits + " " + this.creditType,
        "Session Number: " + this.session,
        "Delivery: In-Person at " + this.location,
        "",
        "This certificate is hereby awarded to " +
          this.name +
          this.mId +
          " for successfully completing",
        "the AIA CES Course: " + this.courseTitle + ", ",
        this.date + ".",
        "",
        this.instructor,
        "Instructor(s)",
        "",
        "Provider's Signature:"
      ];
      // Base64 Encoded Tekstur Logo in Pdf
      var logo =
        "data:image/jpeg;base64,";

      var sig =
        "data:image/jpeg;base64,";

      // Create PDF Parameters
      doc.setFont("helvetica");
      doc.setFontSize(12);
      doc.setFontStyle("bold");
      doc.addImage(logo, "JPEG", 0.5, 0.5, 0.75, 0.75);
      doc.text(title, 0.5, 1.5);
      doc.setFontStyle("normal");
      doc.text(textArray, 0.5, 1.75);
      doc.addImage(sig, "JPEG", 0.5, 4.5, 1.5, 0.75);
      doc.text(this.providerName, 0.5, 5.5);
      doc.setFontSize(8);
      doc.text("Member: " + this.providerNumber, 0.5, 5.75);
      doc.save(pdfTitle);
    },
    open(link) {
      this.$electron.shell.openExternal(link);
    },
    getName: function(val) {
      if (this.$route.query.firstname && this.$route.query.lastname !== null) {
        return this.$route.query.firstname + " " + this.$route.query.lastname;
      } else {
        return val;
      }
    },
    getStreet: function() {
      if (this.$route.query.address) {
        return this.$route.query.address;
      } else {
        return "";
      }
    },
    getCity: function() {
      if (this.$route.query.city) {
        return this.$route.query.city;
      } else {
        return "";
      }
    },
    getState: function() {
      if (this.$route.query.state) {
        return this.$route.query.state;
      } else {
        return "";
      }
    },
    getZip: function() {
      if (this.$route.query.zip) {
        return this.$route.query.zip;
      } else {
        return "";
      }
    },
    fullAddress: function() {
      if (
        this.$route.query.address ||
        this.$route.query.city ||
        this.$route.query.state ||
        this.$route.query.zip
      ) {
        return (
          this.getStreet() +
          ". " +
          this.getCity() +
          ", " +
          this.getState() +
          " " +
          this.getZip()
        );
      } else {
        return "";
      }
    },
    getAiaNumber: function() {
      if (this.$route.query.aia_member_number) {
        return this.$route.query.aia_member_number;
      } else {
        return "";
      }
    },
    getInstructor: function() {
      if (this.$route.query.windows_ces_instructor_name) {
        return this.$route.query.windows_ces_instructor_name;
      } else {
        return "";
      }
    }
  }
};
</script>

